{
  "main_diagnosis": {
    "code": "I50.1",
    "name": "Selhání levé komory",
    "reason": "Hlavní příčinou přijetí na ARO a následného úmrtí bylo akutní srdeční selhání s obrazem kardiogenního šoku. Echokardiografické vyšetření potvrdilo selhání levé komory s nízkou ejekční frakcí. Terapeutické úsilí bylo směřováno primárně k podpoře srdečního výdeje (vazopresory, inotropika). Stav je vyhodnocen jako primární orgánové selhání vedoucí k hospitalizaci.",
    "probability": 95
  },
  "other_potential_main_diagnoses": [
    {
      "code": "R57.0",
      "name": "Kardiogenní šok",
      "reason": "Dominantní klinický projev při přijetí (hypotenze, nutnost poresorické podpory). Dle pravidel kódování se však upřednostňuje základní onemocnění (I50.1), pokud je známo. Jako HD by bylo použito, pokud by nebylo specifikováno konkrétní srdeční onemocnění.",
      "probability": 40
    },
    {
      "code": "J69.0",
      "name": "Pneumonie způsobená potravou a zvratky",
      "reason": "V anamnéze je popsána desaturace bezprostředně po podání Nutridrinku, což naznačuje aspiraci jako spouštěcí moment zhoršení stavu. Byla nasazena antibiotika. Nicméně dominantní obraz a příčina smrti byly kardiální.",
      "probability": 30
    }
  ],
  "secondary_diagnoses": [
    {
      "code": "R57.0",
      "name": "Kardiogenní šok",
      "reason": "Stav vyžadoval agresivní tekutinovou resuscitaci a kombinovanou presorickou podporu (Noradrenalin, Vasopressin). Významně navýšilo náročnost péče.",
      "probability": 98
    },
    {
      "code": "I48.9",
      "name": "Fibrilace síní, neurčená",
      "reason": "V textu popsána 'nově vzniklá Fisi', která byla terapeuticky řešena podáním Cordaronu a Digoxinu.",
      "probability": 95
    },
    {
      "code": "J69.0",
      "name": "Pneumonie způsobená potravou a zvratky",
      "reason": "Podezření na aspiraci (vazba na krmení a desaturaci), nasazena empirická antibiotická terapie (Amoxicilin/kyselina klavulanová).",
      "probability": 85
    },
    {
      "code": "N17.9",
      "name": "Akutní selhání ledvin, neurčené",
      "reason": "Laboratorní známky renální insuficience (Kreatinin 149 umol/l, Urea 18.2 mmol/l, eGFR 0.48 ml/s). Pravděpodobně prerenální etiologie při šoku.",
      "probability": 90
    },
    {
      "code": "D68.9",
      "name": "Porucha srážlivosti, neurčená",
      "reason": "Popisována 'spontánní koagulopatie' s INR 3.24 (bez údaje o Warfarinu). Tento stav vedl k rozhodnutí neprovést punkci pleurálního výpotku (vliv na diagnosticko-terapeutický postup).",
      "probability": 90
    },
    {
      "code": "N39.0",
      "name": "Infekce močového ústrojí bez určení lokalizace",
      "reason": "Mikrobiologický nález E. coli > 10^5 v moči, leukocyturie, zvýšené PCT (1.13 ug/l). Přestože ATB kryla i toto, nález je signifikantní komplikací.",
      "probability": 85
    },
    {
      "code": "B96.2",
      "name": "Escherichia coli jako příčina nemoci",
      "reason": "Identifikované agens u infekce močových cest (kódováno jako doplňkový kód k N39.0).",
      "probability": 95
    },
    {
      "code": "J96.0",
      "name": "Akutní respirační selhání",
      "reason": "Vstupní desaturace 85 %, nutnost oxygenoterapie. Hyperoxémie v ASTRUPU následně svědčí o suplementaci kyslíkem.",
      "probability": 80
    },
    {
      "code": "E87.2",
      "name": "Acidóza",
      "reason": "Významná laktátová acidóza (Laktát 7.1 mmol/l v prvním odběru), ukazatel tkáňové hypoperfuze.",
      "probability": 80
    },
    {
      "code": "J90",
      "name": "Pleurální výpotek, jinde nezařazený",
      "reason": "Diagnostikován na CT (45 mm), zvažována punkce, která byla kontraindikována pro koagulopatii. I pasivní sledování s rozhodovacím procesem opravňuje vykázání.",
      "probability": 75
    }
  ]
}
